import Fetch from 'isomorphic-unfetch';
import React from 'react';
import Table from '../components/table';

const Root = ({ products }) => {
  const columns = [
    {
      Header: 'ID',
      accessor: 'id',
    },
    {
      Header: 'Service',
      accessor: 'service',
    },
    {
      Header: 'Producer',
      accessor: 'producer',
    },
    {
      Header: 'Name',
      accessor: 'name',
    },
    {
      Header: 'EAN',
      accessor: 'ean',
    },
    {
      Header: 'Price',
      accessor: 'price',
    },
    {
      Header: 'CeneoPrice',
      accessor: 'ceneoPrice',
    },
  ];

  return (
    <div>
      <h1>Hello</h1>
      <Table columns={columns} data={products}></Table>
    </div>
  );
};

Root.getInitialProps = async () => {
  const res = await Fetch('http://localhost:3000/api/getProducts');
  console.log(res);
  const data = await res;
  console.log(data);
  return {
    products: data,
  };
};

export default Root;
